    var template = Handlebars.templates['editor.tpl'];
    this.$el.html(template({
      content: this.content,
      path: this.url
    }));

    this._codemirror = new codemirror
    .fromTextArea(this.$el.find('#content')[0], {
      mode: 'scheme',
      lineNumbers: true
    });

